CommonData.BannerCustomCSS:
#onetrust-banner-sdk .ot-sdk-button,
#onetrust-banner-sdk button,
#onetrust-banner-sdk input[type="submit"],
#onetrust-banner-sdk input[type="reset"],
#onetrust-banner-sdk input[type="button"],
#onetrust-pc-sdk .ot-sdk-button,
#onetrust-pc-sdk button,
#onetrust-pc-sdk input[type="submit"],
#onetrust-pc-sdk input[type="reset"],
#onetrust-pc-sdk input[type="button"],
#ot-sdk-cookie-policy .ot-sdk-button,
#ot-sdk-cookie-policy button,
#ot-sdk-cookie-policy input[type="submit"],
#ot-sdk-cookie-policy input[type="reset"],
#ot-sdk-cookie-policy input[type="button"] {
  border-radius: 2em;
}

#onetrust-pc-sdk.otPcCenter {
  border-radius: 0.5em;
  -webkit-box-shadow: 0px 4px 8px 0px rgba(0,0,0,0.3);
  -moz-box-shadow: 0px 4px 8px 0px rgba(0,0,0,0.3);
  box-shadow: 0px 4px 8px 0px rgba(0,0,0,0.3);
}

#onetrust-banner-sdk.otCenterRounded {
  border-radius: 0.5em;
  -webkit-box-shadow: 0px 4px 8px 0px rgba(0,0,0,0.3);
  -moz-box-shadow: 0px 4px 8px 0px rgba(0,0,0,0.3);
  box-shadow: 0px 4px 8px 0px rgba(0,0,0,0.3);
} 

#onetrust-pc-sdk .ot-cat-item>button, 
#onetrust-pc-sdk .ot-acc-cntr>button, 
#onetrust-pc-sdk li>button,
#onetrust-pc-sdk .ot-link-btn,
#onetrust-banner-sdk .ot-link-btn {
    border-radius: 0;
}

#onetrust-pc-sdk .ot-pc-footer-logo {
  display: none;
}

#ot-sdk-btn-floating .ot-floating-button__back,
#ot-sdk-btn-floating .ot-floating-button__front {
  background-color: #0092c3 !important;
  -webkit-box-shadow: 0px 4px 8px 0px rgba(0,0,0,0.3);
  -moz-box-shadow: 0px 4px 8px 0px rgba(0,0,0,0.3);
  box-shadow: 0px 4px 8px 0px rgba(0,0,0,0.3);
}

#onetrust-consent-sdk {
  font-family: ui-sans-serif, system-ui, -system-ui, -apple-system, BlinkMacSystemFont, "Roboto", "Helvetica", "Arial", sans-serif;
}

#onetrust-banner-sdk.ot-bnr-w-logo .ot-bnr-logo {
    margin: 4px 30px;
}

#onetrust-banner-sdk.ot-bnr-w-logo .ot-bnr-logo {
    height: 48px;
    width: auto;
}

@media only screen and (max-width: 600px) {
  #onetrust-pc-sdk .ot-pc-header {
    padding-left: 10px !important;
  }
  #onetrust-banner-sdk.ot-bnr-w-logo .ot-bnr-logo {
    margin: 4px 22px;
  }
}

@media only screen and (max-width: 476px) {
  #onetrust-pc-sdk .ot-pc-footer button {
    width: calc(100% - 33px) !important;
  }
}

@keyframes otFloatingBtnIntroModified {
  0% {
    opacity: 0;
    left: -75px;
  }
  100% {
    opacity: 1;
    left: 10px;
  }
}
#ot-sdk-btn-floating.ot-floating-button {
  animation: otFloatingBtnIntroModified 800ms ease 0ms 1 forwards !important;
}

#onetrust-pc-sdk .pc-logo,
#onetrust-pc-sdk .ot-pc-logo {
  justify-content: left;
}

#onetrust-pc-sdk .ot-tgl input:checked+.ot-switch .ot-switch-nob {
  background-color: #e7f5fd;
  border: 1px solid #0470af;
}

#onetrust-pc-sdk .ot-tgl input:checked+.ot-switch .ot-switch-nob:before {
  background-color: #0470af;
  border-color: #0470af;
}

#onetrust-pc-sdk .ot-vs-list .ot-always-active,
#onetrust-pc-sdk .ot-cat-grp .ot-always-active {
  color: #0470af;
}

#onetrust-pc-sdk #filter-btn-handler {
  background-color: #0470af;
}

#onetrust-pc-sdk .ot-chkbox input:checked~label::before {
  background-color: #0470af;
}

#onetrust-pc-sdk .ot-chkbox label::before {
  border-color: #0470af;
}

